import React from "react";
import Typewriter from "typewriter-effect";

function Type(props) {
  return (
    <Typewriter
      options={{
        strings: [
          `${props.name}`,
          "a Frontend Web Developer",
          "a MERN Stack Developer"
        ],
        autoStart: true,
        loop: true,
        deleteSpeed: 35
      }}
    />
  );
}

export default Type;
